import React from "react";
import mealImage from "../images/Burger_Fries.png"

const ItemsList = ({imageIcons, titles}) => {
  return(
    <div className="ui relaxed divided list">
      <div className="item">
        <img className="item-icon" src={mealImage} alt="meal menu item"/>
        <h1 className="order-text">
          Meals
        </h1>
      </div>
      <div className="item">
        <img className="item-icon" src={mealImage} alt="meal menu item"/>
        <h1 className="order-text">
          Sides
        </h1>
      </div>
    </div>
  );
}

export default ItemsList;
